import React,{use} from "react";
import "./App.css";

// CONTEXT
import { ProjectProvider } from "../context/ProjectsContext";

import ProjectsContext from "./context/ProjectsContext";
// COMPONENTS
import Components from "./components";

// FUNCTIONS
function App() {
  return (
    <div>
      <ProjectsContext>
        <Components />
      </ProjectsContext>
    </div>
  );
}

export default App;
